        static void Main(string[] args)
        {
            var allConfig = File.ReadAllLines(@".\Config.ini");
            int startAcId = Int32.Parse(allConfig[0]);
            int endAcId = Int32.Parse(allConfig[1]);
            int startBoothId = Int32.Parse(allConfig[2]);
            int endBoothId = Int32.Parse(allConfig[3]);
            string outputPath = allConfig[4];

            //string outputPath = @"C:\Users\rajkiran\Desktop\BiharElections\ScrapeVotersList\ScrapeElectoralRolls\Data";
            for (int acId = startAcId; acId <= endAcId; acId++)
            {
                var output = HtmlUtilities.GetPostResponse(acId);
                var dict = HtmlUtilities.ParseResponse(output);
                int boothCount = HtmlUtilities.GetPollingBoothCount(output);
                for (int boothId = startBoothId; boothId <= boothCount; boothId++)
                {
                    var start = DateTime.Now;
                    Console.WriteLine("Getting Electoral Roll for Ac:{0}, Booth:{1}",acId,boothId);
                    string filename = Path.Combine(outputPath, String.Format("ElectoralRoll_{0}_{1}.pdf", acId, boothId));
                    if (File.Exists(filename)) continue;
                    SafeDownloadFile(acId, boothId, filename, dict["__VIEWSTATE"], dict["__EVENTVALIDATION"], dict["__VIEWSTATEGENERATOR"]);
                    Console.WriteLine("Succ. In {0}ms", (DateTime.Now - start).TotalMilliseconds);
                }
            }
        }

        static int retryCount = 0;

        public static string Encode(string str)
        {
            return System.Uri.EscapeDataString(System.Uri.EscapeUriString(str));
        }

        public static void SafeDownloadFile(int acId, int boothId, string filename, string viewState, string eventValidation, string viewStateGenerator)
        {
            try
            {
                //string viewState = System.Uri.EscapeDataString(System.Uri.EscapeUriString(""));
                DownloadFile(acId, boothId, filename, Encode(viewState), Encode(eventValidation), viewStateGenerator);
                retryCount = 0;
            }
            catch(Exception e)
            {
                if (retryCount < 5)
                {
                    retryCount++;
                    SafeDownloadFile(acId, boothId, filename, viewState, eventValidation, viewStateGenerator);
                }
            }
        }

